import React from 'react';
import { Row, Col, Image } from 'antd';
const Product = () => {
  return (
    <Row>
      <Col span={6} offset={0}>
        <Image
          src="https://cdn.tgdd.vn/Products/Images/42/213031/iphone-12-xanh-duong-600x600.jpg"
          width={360}
          height={343}
        />
      </Col>
      <Col span={6}>col-6</Col>
      <Col span={6}>col-6</Col>
      <Col span={6}>col-6</Col>
    </Row>
  );
};

export default Product;
